    Breed(key='sussex_spaniel', name='서식스 스패니얼(Sussex Spaniel)', info='서식스 스패니얼은 차분한 성격과 뛰어난 후각으로 유명한 희귀 견종입니다. 가족과 잘 어울리며 적당한 운동을 좋아해, 더 여유로운 생활을 선호하는 사람들에게 좋은 동반자가 됩니다. 긴 촘촘한 털을 가지고 있어 규칙적인 손질이 필요합니다. 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 애정이 넘치고 온화한 성격을 가지고 있습니다.'),
    Breed(key='border_terrier', name='보더 테리어(Border Terrier)', info='보더 테리어는 작고 에너지가 넘치는 견종으로, 애정이 많고 두려움이 없는 성격을 가지고 있습니다. 아이들과 다른 애완동물들과 잘 어울리며, 훌륭한 가족 동반자가 됩니다. 짧고 촘촘한 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 활동적이며, 달리기와 놀기를 즐깁니다. 친근하고 사교적인 성격을 가지고 있어 다른 개들과도 잘 어울립니다.'),
    Breed(key='japanese_spaniel', name='일본 스패니얼(Japanese Spaniel)', info='일본 친이라고도 알려진 이 작은 우아한 견종은 애정이 많고 장난기 넘치는 성격으로 유명합니다. 큰 동그란 눈과 실키한 털을 가지고 있는 독특한 외모를 자랑합니다. 친근하고 사교적인 성격으로 아이들과 다른 애완동물과도 잘 어울립니다. 규칙적인 손질이 필요하며, 온화하고 애정이 많은 성격으로 주인과 강한 유대감을 형성합니다.'),
    Breed(key='golden_retriever', name='골든 리트리버(Golden Retriever)', info='골든 리트리버는 친근하고 지능적이며 다재다능한 견종으로, 훌륭한 가족 애완견입니다. 충성심이 강하고 훈련이 쉬워 다양한 개 스포츠와 활동에서 뛰어난 성과를 보입니다. 두꺼운 방수 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 활동적이며, 지능을 필요로 하는 활동을 즐깁니다. 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다.'),
    Breed(key='saluki', name='살루키(Saluki)', info='살루키는 고대 견종으로, 우아함과 속도, 사냥 능력으로 유명합니다. 온화하고 충성심이 강하며, 주인과 강한 유대감을 형성합니다. 짧고 매끈한 털을 가지고 있어 관리가 비교적 쉽습니다. 매우 활동적이며, 달리기와 놀기를 즐깁니다. 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다.'),
    Breed(key='eskimo_dog', name='에스키모 독(Eskimo Dog)', info='아메리칸 에스키모 독으로도 알려져 있는 이 견종은 부드러운 흰색 털과 친근하고 경계심이 강한 성격으로 유명합니다. 매우 지능적이며, 정신적 자극을 필요로 하는 활동을 즐깁니다. 두꺼운 이중 털을 가지고 있어 규칙적인 손질이 필요합니다. 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 가족과 함께하기에 훌륭한 동반자가 됩니다.'),
    Breed(key='bernese_mountain_dog', name='버니즈 마운틴 독(Bernese Mountain Dog)', info='버니즈 마운틴 독은 대형이고 온화한 견종으로, 친근하고 애정이 많은 성격으로 가족과 잘 어울립니다. 야외 활동을 즐기는 사람들에게 좋은 동반자가 됩니다. 두꺼운 이중 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 애정이 많고 온화한 성격을 가지고 있습니다.'),
    Breed(key='soft-coated_wheaten_terrier', name='소프트 코티드 휘튼 테리어(Soft-Coated Wheaten Terrier)', info='소프트 코티드 휘튼 테리어는 부드럽고 실키한 털과 친근한 성격으로 유명한 중형 견종입니다. 아이들과 잘 어울리며, 가족과 함께하기에 훌륭한 동반자가 됩니다. 털이 꼬이지 않도록 규칙적인 손질이 필요합니다. 매우 활동적이며, 달리기와 놀기를 즐깁니다. 친근하고 사교적인 성격을 가지고 있어 다른 애완동물과도 잘 어울립니다.'),
    Breed(key='blenheim_spaniel', name='블렌하임 스패니얼(Blenheim Spaniel)', info='캐벌리어 킹 찰스 스패니얼로도 알려진 이 견종은 애정이 많고 온화한 성격으로 유명합니다. 큰 동그란 눈과 실키한 털을 가진 독특한 외모를 자랑합니다. 친근하고 사교적인 성격으로 아이들과 다른 애완동물과도 잘 어울립니다. 규칙적인 손질이 필요하며, 온화하고 애정이 많은 성격으로 주인과 강한 유대감을 형성합니다.'),
    Breed(key='french_bulldog', name='프렌치 불독(French Bulldog)', info='프렌치 불독은 작고 근육질의 견종으로, 개성이 넘칩니다. 친근하고 장난기 많은 성격으로 훌륭한 동반자가 됩니다. 짧고 매끈한 털을 가지고 있어 관리가 비교적 쉽습니다. 매우 사교적이며 주인과 함께하는 시간을 즐기며, 아이들과 다른 애완동물과도 잘 어울립니다. 친근하고 애정이 많아 가족과 강한 유대감을 형성합니다.'),
    Breed(key='ibizan_hound', name='이비잔 하운드(Ibizan Hound)', info='이비잔 하운드는 고대 사냥견으로, 우아함과 속도, 민첩성으로 유명합니다. 온화하고 가족과 함께하기에 좋은 동반자가 됩니다. 짧고 매끈한 털을 가지고 있어 관리가 비교적 쉽습니다. 매우 활동적이며, 달리기와 놀기를 즐깁니다. 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다.'),
    Breed(key='clumber', name='클럼버(Clumber)', info='클럼버 스패니얼은 차분한 성격과 충성심, 뛰어난 사냥 능력으로 유명합니다. 두꺼운 방수 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 가족과 잘 어울리며 적당한 운동을 좋아해, 여유로운 생활을 선호하는 사람들에게 좋은 동반자가 됩니다.'),
    Breed(key='english_springer', name='잉글리시 스프링어(English Springer)', info='잉글리시 스프링어 스패니얼은 활기차고 친근한 성격으로, 훌륭한 가족 애완견이자 숙련된 사냥견입니다. 긴 물결 모양의 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 활동적이며, 지능과 신체 능력을 필요로 하는 활동을 즐깁니다. 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다.'),
    Breed(key='komondor', name='코몬도르(Komondor)', info='코몬도르는 독특한 끈 모양의 털을 가진 외모로 유명합니다. 보호 본능이 강해 훌륭한 가축 보호견 역할을 하며, 가족과 강한 유대감을 형성합니다. 두꺼운 털을 가지고 있어 끈 모양의 특유의 외모를 유지하기 위해 특별한 손질이 필요합니다. 매우 활동적이며, 보호와 방어와 관련된 활동을 즐깁니다. 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다.'),
    Breed(key='basenji', name='바센지(Basenji)', info='바센지는 고대 견종으로, 독특한 요들 소리와 지능, 독립성으로 유명합니다. 짧고 매끈한 털과 뾰족한 귀를 가진 독특한 외모를 자랑합니다. 매우 활동적이며, 지능과 신체 능력을 필요로 하는 활동을 즐깁니다. 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 손질이 비교적 쉽지만, 규칙적인 운동과 정신적 자극이 필요합니다.'),
    Breed(key='irish_wolfhound', name='아이리시 울프하운드(Irish Wolfhound)', info='아이리시 울프하운드는 가장 큰 견종 중 하나로, 온화하고 차분한 성격으로 유명합니다. 가족과 잘 어울리며, 야외 활동을 즐기는 사람들에게 좋은 동반자가 됩니다. 두꺼운 거친 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 온화하고 애정이 많은 성격을 가지고 있어 주인과 강한 유대감을 형성합니다.'),
    Breed(key='scottish_deerhound', name='스코티시 디어하운드(Scottish Deerhound)', info='스코티시 디어하운드는 대형이고 우아한 견종으로, 온화한 성격과 뛰어난 사냥 능력으로 유명합니다. 긴 거친 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 활동적이며, 달리기와 놀기를 즐깁니다. 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 야외 활동을 즐기는 사람들에게 좋은 동반자가 됩니다.'),
    Breed(key='pekinese', name='페키니즈(Pekinese)', info='페키니즈는 작은 크기의 고귀한 견종으로, 독립적이고 사자 같은 외모가 특징입니다. 긴 흐르는 털을 가지고 있어 규칙적인 손질이 필요합니다. 충성심이 강하고 애정이 많아 주인과 강한 유대감을 형성합니다. 작은 크기에도 불구하고 대담하고 자신감 넘치는 성격을 가지고 있으며, 더 여유로운 생활을 선호하는 사람들에게 좋은 동반자가 됩니다.'),
    Breed(key='maltese_dog', name='말티즈(Maltese Dog)', info='말티즈는 작은 크기의 장난기 많은 견종으로, 긴 실키한 흰 털과 친근한 성격으로 유명합니다. 긴 흐르는 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 애정이 많아 주인과 강한 유대감을 형성합니다. 작은 크기에도 불구하고 대담하고 자신감 넘치는 성격을 가지고 있으며, 더 여유로운 생활을 선호하는 사람들에게 좋은 동반자가 됩니다.'),
    Breed(key='leonberg', name='레온베르거(Leonberg)', info='레온베르거는 대형이고 온화한 견종으로, 친근하고 애정이 많은 성격으로 가족과 잘 어울립니다. 두꺼운 이중 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 야외 활동을 즐기는 사람들에게 좋은 동반자가 됩니다. 온화하고 애정이 많은 성격을 가지고 있어 주인과 강한 유대감을 형성합니다.'),
    Breed(key='schipperke', name='스키퍼키(Schipperke)', info='스키퍼키는 작고 활기찬 견종으로, 여우 같은 얼굴과 장난기 넘치는 성격으로 유명합니다. 두꺼운 이중 털을 가지고 있어 규칙적인 손질이 필요합니다. 매우 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 야외 활동을 즐기는 사람들에게 좋은 동반자가 됩니다. 온화하고 애정이 많은 성격을 가지고 있어 주인과 강한 유대감을 형성합니다.'),
    Breed(key='bull_mastiff', name='불마스티프(Bull Mastiff)', info='불마스티프는 대형이고 힘이 넘치는 견종으로, 보호 본능이 강하고 온화한 성격으로 유명합니다. 두꺼운 근육질의 체형과 짧고 매끈한 털을 가지고 있어 관리가 비교적 쉽습니다. 충성심이 강하고 애정이 많아 가족과 강한 유대감을 형성합니다. 훌륭한 경비견이자 가족 동반자가 되며, 야외 활동을 즐기는 사람들에게 좋은 동반자가 됩니다. 온화하고 애정이 많은 성격을 가지고 있습니다.'),
    Breed(key='great_dane', name='그레이트 데인(Great Dane)', info='그레이트 데인은 인상적인 크기와 온화한 성격으로 유명합니다. 높은 키와 근육질의 체형, 짧고 매끈한 털을 가지고 있어 관리가 비교적 쉽습니다. 매우 친근하고 사교적인 성격을 가지고 있어 아이들과 다른 애완동물과도 잘 어울립니다. 가족과 함께하기에 훌륭한 동반자가 되며, 야외 활동을 즐기는 사람들에게 좋은 동반자가 됩니다. 온화하고 애정이 많은 성격을 가지고 있어 주인과 강한 유대감을 형성합니다.'),
