    Breed(key='miniature_pinscher', name='미니어처 핀셔(Miniature Pinscher)', info='미니어처 핀셔는 작고 에너지가 넘치는 견종으로, 두려움 없는 성격과 활기찬 성격으로 유명합니다. 짧고 매끈한 털을 가지고 있어 관리가 비교적 쉽습니다. 애정이 많아 주인과 강한 유대감을 형성합니다. 작은 크기에도 불구하고 대담하고 자신감 넘치는 성격을 가지고 있으며, 활동적인 생활을 즐기는 사람들에게 좋은 동반자가 됩니다.'),
